INSERT INTO `refTheSpace` VALUES (1,'Welcome to our picturesque rural villa in the valley of Tramuntana Mountains and enjoy Mallorca with a difference!\n\n\n\n- Location of the villa\n\nOur villa is located in the countryside, most precisely in the rural area of well-known Inca, Mallorcas famous leather town and 30 minutes drive to Palmas International Airport. It is also situated 2km from Selva, a very charming mallorcan town and 2km from Mancor de la Vall, an enchanted small town both of them situated in the Valley of Tramuntana Mountains. This breathtaking scenery is one of the greatest marvels of Mallorca Island, a very beautiful and relaxing place for those interested in meaningful holidays within the essence of Mallorcas nature and culture.\n\nThe villa is situated exactly in the km 2 from Inca on the road to Mancor with easy access to all the charming towns in the area. Very well located for treking, biking or simply contemplating the landscape around. It also has easy access to Pollensa and Alcudia with its amazing beaches in the north of the Island.\n\n\n- Description of the villa\n\nThis delightful, rustic and charming villa with its fabulous position enjoys picturesque gardens with lots of trees. The house is well furnished and can accommodate up to 2 people and a cot can be provided. as villa is ideal for painters, writers, researchers, walkers, nature and retreat lovers alike, with its fascinating surrounding areas.Undoubtedly, perfect for a relaxing and inspiring holiday in the Island.\n\n- Layout of the house\n*1 bedroom\n* Bathroom with shower, WC.\n* Comfortable living room & dining area. and TV,\n* Open plan kitchen with microwave, oven, hob, refrigerator and dishwasher.\n\n- Outside the villa\n* Terrace furnished with garden table and chairs.\n* Shared swimming pool\n* Barbecue facilities .\n* Front and back gardens, the later with magnificent views of the mountains, specially recommended for sunset contemplation.\n* Plenty of parking spaces.\n\nFacts1 bedroom\n1 bathroom\nA bed for two people and if more than two can add an extra bed or a park-cradle\n60m² living area \n150m² terrace area\n\n- Attractions near by\n\nThere are so many beautiful places to see and enjoy in the surroundings areas of Tramuntana Mountains and Mallorca as a whole that results very difficult to choose only a few, but here are some tips highly recommended:\n\n* Tramuntana Mountains, this magnificent landscape of the island, besides its natural beauty there are a diversity of villages located in the valley or either in the Mediterranean coast side. Perfect for body and soul. Very inspiring place indeed!\n* Monastery of Lluc: The monastery is located at the top of the mountain and from there you can take pleasure of having one of the most stunning views.\n* Sa Calobra, crossing the mountain string and down to the sea this is one of the most unbelievable places in the Mediterranean coast.\n* Santa Lucia Santuary situated in the top of a hill in the charming town of Mancor and just about 2Km from Son Bonafe Villa. It is a great start point for a trekking or biking around.\n* Selva, just 2Km from the Villa. It is a picturesque town in the Valley of Tramuntana Mountains, with amazing views which could be enjoyed in a pleasant terrace close to the town church whilst trying typical mallorcan \"tapas\".\n* Pollensas and Alcudias beaches only 30 minutes drive away\n* Villages and towns markets with a local and peculiar atmosphere in Consell, Santa Maria, Inca and Sa Pobla.\n* Sineu. This town has a well deserved reputation for having the best restaurants of typical Mallorcan food.\n* Palma, the Capital of the Island with lots of things to see and to do. Do not forget to visit the The Cathedral - La Seu, Bellver Castle, Es Baluard Museum and take some pleasant walks along the historic town center - Sa Lonja and by the sea - Paseig Maritim.\n\nWe remind that prices can vary depending on the season, please consult prices on the calendar.\n\nPREPARE YOUR BOOTS AND WALKING\nOR YOUR MOUNTAIN BIKE\n\nThe mountain is waiting!'),(2,'Maecenas tristique, est et tempus semper, est quam pharetra magna, ac consequat metus sapien ut nunc. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Mauris viverra diam vitae quam. Suspendisse potenti.\n\nNullam porttitor lacus at turpis. Donec posuere metus vitae ipsum. Aliquam non mauris.\n\nMorbi non lectus. Aliquam sit amet diam in magna bibendum imperdiet. Nullam orci pede, venenatis non, sodales sed, tincidunt eu, felis.\n\nFusce posuere felis sed lacus. Morbi sem mauris, laoreet ut, rhoncus aliquet, pulvinar sed, nisl. Nunc rhoncus dui vel sem.\n\nSed sagittis. Nam congue, risus semper porta volutpat, quam pede lobortis ligula, sit amet eleifend pede libero quis orci. Nullam molestie nibh in lectus.\n\nPellentesque at nulla. Suspendisse potenti. Cras in purus eu magna vulputate luctus.\n\nCum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Vivamus vestibulum sagittis sapien. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.\n\nEtiam vel augue. Vestibulum rutrum rutrum neque. Aenean auctor gravida sem.'),(3,'In sagittis dui vel nisl. Duis ac nibh. Fusce lacus purus, aliquet at, feugiat non, pretium quis, lectus.\n\nSuspendisse potenti. In eleifend quam a odio. In hac habitasse platea dictumst.\n\nMaecenas ut massa quis augue luctus tincidunt. Nulla mollis molestie lorem. Quisque ut erat.\n\nCurabitur gravida nisi at nibh. In hac habitasse platea dictumst. Aliquam augue quam, sollicitudin vitae, consectetuer eget, rutrum at, lorem.\n\nInteger tincidunt ante vel ipsum. Praesent blandit lacinia erat. Vestibulum sed magna at nunc commodo placerat.\n\nPraesent blandit. Nam nulla. Integer pede justo, lacinia eget, tincidunt eget, tempus vel, pede.\n\nMorbi porttitor lorem id ligula. Suspendisse ornare consequat lectus. In est risus, auctor sed, tristique in, tempus sit amet,